- input: "TEXT\x1CC00200659\x1C.TEXT\x1C\x1CF3XN\x1CIn the course of an internal PAC
    audit, the following issues were discovered: 1) Amy Jacob Forshew terminated employment
    10/31/02. Her last PAC payroll contribution of $10 was not disclosed on the committee's
    FEC report covering through 10/31/02. 2) Marilyn Castaldi terminated employment
    10/31/02. Her last PAC payroll contribution of $40 was not disclosed on the committee's
    FEC report covering through 10/31/02. 3) Two bank charges were not disclosed on
    the committee's  FEC reports:  $39.73 (10/22/04); and $13.66 (11/23/04).  We have
    disclosed a corrective entry showing a disbursement of $3.39 on Line 29 of this
    report rather than amending the committee's reports from 2002 to the present.
    Also note that stop payments on 14 uncashed checks dating between the years 2000
    and 2007 were issued on 6/16/08. This report discloses  negative entries on Lines
    23 and 29, which represent voids of these contributions."
